export function searchLoinc(query: string, limit = 50): LoincCode[] {
  const q = query.toLowerCase()
  return LOINC_DATABASE
    .filter(c =>
      c.name.toLowerCase().includes(q) ||
      c.code.includes(q) ||
      c.component.toLowerCase().includes(q)
    )
    .slice(0, limit)
}
